import React, { Component } from "react";

class Details extends Component {
  state = {};
  render() {
    const { data } = this.props || [];
    console.log(data);
    return (
      <div className="border bg-light p-2 ">
        <div className="row" style={{ justifyContent: "center" }}></div>
      </div>
    );
  }
}

export default Details;
